def one_iteration(lambda_f1, beta, p, tk, tcpu, c, thdd, Tdo, Tp):
    Tk = (2 * tk) / (1 - 2 * lambda_f1 * tk)
    Tcpu = (beta * tcpu) / (1 - (beta * lambda_f1 * tcpu / c) ** c)
    Thdd = (beta * thdd) / (1 - beta * p * lambda_f1 * thdd)
    Tc = Tdo + Tp + Tk + Tcpu + Thdd
    Tr = Tc - Tp
    return Tc, Tk, Tr, Tcpu, Thdd


def calculate(P, m, K1, tk_direct, tk_reverse, c, tcpu, thdd, N, K2, delta, Tdo, Tp):
    tk = (tk_direct + tk_reverse) / 2
    beta = 1 / (1 - P)
    p = 1 / m
    if tk == 0:
        lambda_f1 = 0
    else:
        lambda_f1 = K1 * min(1 / (2 * tk),
                             c / (beta * tcpu),
                             1 / (beta * p * thdd)) * (N - 1) / N
    Tc, Tk, Tr, Tcpu, Thdd = one_iteration(lambda_f1, beta, p, tk, tcpu, c, thdd, Tdo, Tp)
    lambda_f = (N - 1) / Tc
    counter = 1
    while not (abs((lambda_f1 - lambda_f) / lambda_f) < delta):
        lambda_f1 -= (lambda_f1 - lambda_f) / K2
        Tc, Tk, Tr, Tcpu, Thdd = one_iteration(lambda_f1, beta, p, tk, tcpu, c, thdd, Tdo, Tp)
        lambda_f = (N - 1) / Tc
        counter += 1

    lambda_finale = N / Tc
    rho_k = 2 * lambda_finale * tk
    rho_station = (Tdo + Tp) / Tc
    rho_user = Tp / Tc
    rho_cpu = beta * lambda_finale * tcpu / c
    rho_hdd = beta * p * lambda_finale * thdd
    ave_pc = N * rho_station
    return rho_station, rho_user, ave_pc, rho_k, rho_cpu, rho_hdd, Tc, Tr, lambda_f, lambda_finale, counter


